var renderSkills = function(totalSkills){
    var splitCharacter = "";
    $.each(totalSkills, function (ckey, cval) {
        splitCharacter = ckey < totalSkills.length -1 ? ", ": "";
        $('<b/>')
            .text(cval)
            .append(splitCharacter)
            .appendTo($("#totalSkills"));
    });

}

renderSkills(totalSkills);

function getDateText(startDateText, endDate){
    var startDate = new Date(startDateText);
    var startText = `${startDate.toLocaleString('default', { month: 'short' })} ${startDate.getFullYear()}`;
    var endText = "Present";
    if (endDate !== 'Present'){
        endDate = new Date(endDate);
        endText = `${endDate.toLocaleString('default', { month: 'short' })} ${endDate.getFullYear()}`;
    }
    else
        endDate = new Date();
    var duration = new Date(endDate - startDate);
    var diffInYear = duration.toISOString().slice(0, 4) - 1970;
    var diffInYearText = diffInYear == 1? "1 yr ": (diffInYear>0? `${diffInYear} yrs `: '');
    return {
        text: `${startText} - ${endText}`,
        duration: `${diffInYearText}${duration.getMonth()+1} mos`
    };
}

var renderProjects = function(projects, root){
    root.text("Projects (");
    $.each(projects, function (ckey, cval) {
        if (cval.href){
            $('<a/>')
                .addClass('profile-detail')
                .attr('href', cval.href)
                .attr('target', "_blank")
                .text(cval.name)
                .appendTo(root);
        }
        else{
            $('<span/>')
                .addClass('.profile-detail')
                .css({"color" : "black"})
                .text(cval.name)
                .appendTo(root);
        }
        if (ckey < projects.length-1) root.append(", ");
    });
    root.append(")");
}

var renderContent = function(contents, utilized, root){
    $.each(contents, function (ckey, cval) {
        $('<p/>')
            .addClass('.profile-detail')
            .css({"line-height": "1.6", "font-size": "13px", align : "justify"})
            .html(" - "+cval)
            .appendTo(root);
    });

    $('<p/>')
        .addClass('.profile-detail')
        .css({"line-height": "1.6", "font-size": "15px"})
        .html(" - Utilized: <b>"+utilized.join(", ") + "</b>")
        .appendTo(root);
}

